{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<h3>\u0414\u043e XIX \u0432\u0435\u043a\u0430 <\/h3> <ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/345_%D0%B3%D0%BE%D0%B4\" title=\"345 \u0433\u043e\u0434\">345<\/a>&#160;\u2014 \u043f\u0430\u043f\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BB%D0%B8%D0%B9_I\" title=\"\u042e\u043b\u0438\u0439 I\">\u0418\u0443\u043b\u0438\u0435\u043c I<\/a> \u0432\u043e \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%81%D0%B5%D0%B2%D0%B8%D0%B9_%D0%B8%D0%B7_%D0%92%D0%B5%D1%80%D1%87%D0%B5%D0%BB%D0%BB%D0%B8\" title=\"\u0415\u0432\u0441\u0435\u0432\u0438\u0439 \u0438\u0437 \u0412\u0435\u0440\u0447\u0435\u043b\u043b\u0438\">\u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u0432\u0441\u0435\u0432\u0438\u0439<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0435\u043f\u0438\u0441\u043a\u043e\u043f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%87%D0%B5%D0%BB%D0%BB%D0%B8\" title=\"\u0412\u0435\u0440\u0447\u0435\u043b\u043b\u0438\">\u0412\u0435\u0440\u0447\u0435\u043b\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/533_%D0%B3%D0%BE%D0%B4\" title=\"533 \u0433\u043e\u0434\">533<\/a>&#160;\u2014 \u0432 \u0431\u0438\u0442\u0432\u0435 \u0443 \u0422\u0438\u043a\u0430\u043c\u0435\u0440\u043e\u043d\u0430 (\u0422\u0440\u0438\u043a\u0430\u043c\u0430\u0440) \u0430\u0440\u043c\u0438\u044f \u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u043a\u043e\u0432\u043e\u0434\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%B7%D0%B0%D1%80%D0%B8%D0%B9\" title=\"\u0412\u0435\u043b\u0438\u0437\u0430\u0440\u0438\u0439\">\u0412\u0435\u043b\u0438\u0437\u0430\u0440\u0438\u044f<\/a> \u0440\u0430\u0437\u0431\u0438\u043b\u0430 \u0432\u043e\u0439\u0441\u043a\u043e \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%B4%D0%B0%D0%BB%D1%8B\" title=\"\u0412\u0430\u043d\u0434\u0430\u043b\u044b\">\u0432\u0430\u043d\u0434\u0430\u043b\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BB%D0%B8%D0%BC%D0%B5%D1%80\" title=\"\u0413\u0435\u043b\u0438\u043c\u0435\u0440\">\u0413\u0435\u043b\u0438\u043c\u0435\u0440\u0430<\/a>, \u0432\u0441\u043a\u043e\u0440\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%B2%D0%B0%D0%BD%D0%B4%D0%B0%D0%BB%D0%BE%D0%B2_%D0%B8_%D0%B0%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0432\u0430\u043d\u0434\u0430\u043b\u043e\u0432 \u0438 \u0430\u043b\u0430\u043d\u043e\u0432\">\u0432\u0430\u043d\u0434\u0430\u043b\u043e\u0432<\/a> \u0432 \u0410\u0444\u0440\u0438\u043a\u0435 \u0438 \u0432\u043e\u0432\u0441\u0435 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u043b\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/687_%D0%B3%D0%BE%D0%B4\" title=\"687 \u0433\u043e\u0434\">687<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%80%D0%B3%D0%B8%D0%B9_I\" title=\"\u0421\u0435\u0440\u0433\u0438\u0439 I\">\u0421\u0435\u0440\u0433\u0438\u0439 I<\/a> (\u043b\u0430\u0442. Sergius PP. I) \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f 84-\u043c \u0440\u0438\u043c\u0441\u043a\u0438\u043c \u043f\u0430\u043f\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/944_%D0%B3%D0%BE%D0%B4\" title=\"944 \u0433\u043e\u0434\">944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_I_%D0%9B%D0%B0%D0%BA%D0%B0%D0%BF%D0%B8%D0%BD\" title=\"\u0420\u043e\u043c\u0430\u043d I \u041b\u0430\u043a\u0430\u043f\u0438\u043d\">\u0420\u043e\u043c\u0430\u043d\u0430 I<\/a> \u0441\u0432\u0435\u0440\u0433\u043b\u0438 \u0435\u0433\u043e \u0441\u044b\u043d\u043e\u0432\u044c\u044f, \u043d\u0430\u0434\u0435\u044f\u0441\u044c \u043f\u0440\u0430\u0432\u0438\u0442\u044c \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e, \u043e\u0434\u043d\u0430\u043a\u043e \u044d\u0442\u043e \u0432\u044b\u0437\u0432\u0430\u043b\u043e \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0435 \u0432\u043e\u043b\u043d\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0443\u0442\u0438\u0445\u043b\u0438 \u043b\u0438\u0448\u044c \u043a\u043e\u0433\u0434\u0430 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_VII_%D0%91%D0%B0%D0%B3%D1%80%D1%8F%D0%BD%D0%BE%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9\" title=\"\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d VII \u0411\u0430\u0433\u0440\u044f\u043d\u043e\u0440\u043e\u0434\u043d\u044b\u0439\">\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u0430<\/a>. \u0427\u0435\u0440\u0435\u0437 40 \u0434\u043d\u0435\u0439 \u0438\u0445 \u0441\u043e\u0441\u043b\u0430\u043b\u0438 \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1055_%D0%B3%D0%BE%D0%B4\" title=\"1055 \u0433\u043e\u0434\">1055<\/a>&#160;\u2014 \u0441 \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u044f \u0445\u0430\u043b\u0438\u0444\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C-%D0%9A%D0%B0%D0%B8%D0%BC_%D0%91%D0%B8%D0%B0%D0%BC%D1%80%D0%B8%D0%BB%D0%BB%D0%B0%D1%85\" title=\"\u0410\u043b\u044c-\u041a\u0430\u0438\u043c \u0411\u0438\u0430\u043c\u0440\u0438\u043b\u043b\u0430\u