0%B8%D0%BB%D0%B8%D0%B8)\" title=\"\u042d\u043d\u0440\u0438\u043a\u0435 III (\u043a\u043e\u0440\u043e\u043b\u044c \u041a\u0430\u0441\u0442\u0438\u043b\u0438\u0438)\">\u043a\u043e\u0440\u043e\u043b\u044e<\/a> \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432\u043d\u0443\u044e \u0436\u0430\u043b\u043e\u0431\u0443 \u043d\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u044b\u0445 \u0432\u043b\u0430\u0441\u0442\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1448_%D0%B3%D0%BE%D0%B4\" title=\"1448 \u0433\u043e\u0434\">1448<\/a>&#160;\u2014 \u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u043e\u043c&#160;\u2014 \u041f\u0440\u0435\u0434\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u0435\u043c \u0420\u0443\u0441\u0441\u043a\u043e\u0439 \u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438 \u0441\u043e\u0431\u043e\u0440 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u043e\u0432 \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%BD%D0%B0_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0418\u043e\u043d\u0430 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439\">\u0440\u044f\u0437\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0418\u043e\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1589_%D0%B3%D0%BE%D0%B4\" title=\"1589 \u0433\u043e\u0434\">1589<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_I_%D0%B4%D0%B5_%D0%91%D1%83%D1%80%D0%B1%D0%BE%D0%BD_(%D0%B0%D1%80%D1%85%D0%B8%D0%B5%D0%BF%D0%B8%D1%81%D0%BA%D0%BE%D0%BF_%D0%A0%D1%83%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9)\" title=\"\u041a\u0430\u0440\u043b I \u0434\u0435 \u0411\u0443\u0440\u0431\u043e\u043d (\u0430\u0440\u0445\u0438\u0435\u043f\u0438\u0441\u043a\u043e\u043f \u0420\u0443\u0430\u043d\u0441\u043a\u0438\u0439)\">\u043a\u0430\u0440\u0434\u0438\u043d\u0430\u043b \u0434\u0435 \u0411\u0443\u0440\u0431\u043e\u043d<\/a> \u043f\u0440\u0438\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u043e\u0442\u043b\u0438\u0432\u0430\u0442\u044c \u043c\u043e\u043d\u0435\u0442\u044b \u0441 \u043f\u0440\u043e\u0444\u0438\u043b\u0435\u043c \u0443\u043c\u0435\u0440\u0448\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_III_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 III (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u0413\u0435\u043d\u0440\u0438\u0445\u0430 III<\/a> \u0438 \u043d\u0430\u0447\u0430\u0442\u044c \u0447\u0435\u043a\u0430\u043d\u0438\u0442\u044c \u0441\u043e \u0441\u0432\u043e\u0438\u043c \u043f\u0440\u043e\u0444\u0438\u043b\u0435\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1598_%D0%B3%D0%BE%D0%B4\" title=\"1598 \u0433\u043e\u0434\">1598<\/a>&#160;\u2014 20 \u0442\u044b\u0441\u044f\u0447 \u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0445 \u0441\u043e\u043b\u0434\u0430\u0442 \u0438\u0437 \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u0435\u0439 \u0432 \u0421\u0430\u0447\u0445\u043e\u043d\u0435, \u041d\u0430\u043c\u0445\u044d \u0438 \u041a\u043e\u0441\u043e\u043d\u0435 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u0428\u0438\u043c\u0430\u0446\u0443 \u0419\u043e\u0441\u0438\u0445\u0438\u0440\u043e \u043f\u043e\u0433\u0440\u0443\u0437\u0438\u043b\u0438\u0441\u044c \u043d\u0430 500 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439 \u0438 \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0438\u0441\u044c \u043d\u0430 \u0432\u044b\u0440\u0443\u0447\u043a\u0443 \u0431\u043b\u043e\u043a\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u043c \u0432 \u041a\u043e\u0440\u0435\u0435 \u0432\u043e\u0439\u0441\u043a\u0430\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1649_%D0%B3%D0%BE%D0%B4\" title=\"1649 \u0433\u043e\u0434\">1649<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\">\u0428\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f<\/a> (\u0448\u0432\u0435\u0434. Svenska Afrikanska Kompaniet) \u0438\u043b\u0438 \u0413\u0432\u0438\u043d\u0435\u0439\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f (\u0448\u0432\u0435\u0434. Guineakompaniet)&#160;\u2014 \u0448\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u0442\u043e\u0440\u0433\u043e\u0432\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f, \u0434\u043b\u044f \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438 \u0441 \u0410\u0444\u0440\u0438\u043a\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1762_%D0%B3%D0%BE%D0%B4\" title=\"1762 \u0433\u043e\u0434\">1762<\/a>&#160;\u2014 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0430 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0430 \u041c\u0430\u043d\u0438\u0444\u0435\u0441\u0442 \u00ab\u041e \u043f\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u0438\u0438 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u0446\u0430\u043c, \u043a\u0440\u043e\u043c\u0435 \u0436\u0438\u0434\u043e\u0432, \u0432\u044b\u0445\u043e\u0434\u0438\u0442\u044c \u0438 \u0441\u0435\u043b\u0438\u0442\u044c\u0441\u044f \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0438 \u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u043c \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0432 \u0441\u0432\u043e\u0451 \u043e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u043e \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u043b\u044e\u0434\u0435\u0439, \u0431\u0435\u0436\u0430\u0432\u0448\u0438\u0445 \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443\u00bb. \u0412 \u044d\u0442\u043e\u043c \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0435 \u0434\u0435\u043a\u043b\u0430\u0440\u0438\u0440\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u044b \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 \u043d\u043e\u0432\u043e\u0433\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u0420\u043e\u0441\u0441\u0438\u0438: \u0443\u0432\u0435\u043b\u0438\u0447\u0435\u043d\u0438\u0435 \u0447\u0438\u0441\u043b\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0441\u0442\u0440\u0430\u043d\u044b \u0437\u0430 \u0441\u0447\u0451\u0442 \u043f\u0440\u0438\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u044f \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u0446\u0435\u0432 \u0438 \u0430\u043c\u043d\u0438\u0441\u0442\u0438\u044f \u043f\u043e\u0434\u0434\u0430\u043d\u043d\u044b\u0445 \u0420\u043e\u0441\u0441\u0438\u0438, \u043f\u043e\u043a\u0438\u043d\u0443\u0432\u0448\u0438\u0445 \u0440\u043e\u0434\u0438\u043d\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1791_%D0%B3%D0%BE%D0%B4\" title=\"1791 \u0433\u043e\u0434\">1791<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0432\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D0%BB%D0%BB%D1%8C_%D0%BE_%D0%BF%D1%80%D0%B0%D0%B2%D0%B0%D1%85_(%D0%A1%D0%A8%D0%90)\" title=\"\u0411\u0438\u043b\u043b\u044c \u043e \u043f\u0440\u0430\u0432\u0430\u0445 (\u0421\u0428\u0410)\">\u0411\u0438\u043b\u043b\u044c \u043e \u043f\u0440\u0430\u0432\u0430\u0445<\/a>&#160;\u2014 \u0434\u0435\u0441\u044f\u0442\u044c \u043f\u043e\u043f\u0440\u0430\u0432\u043e\u043a \u0438 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0439 \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0421\u0428\u0410\">\u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 1787<\/a>, \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0437\u0430\u043a\u0440\u0435\u043f\u0438\u0432\u0448\u0438\u0445 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0432\u0430\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0432\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0_%D1%81%D0%BE%D0%B2%D0%B5%D1%81%D1%82%D0%B8\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u0441\u043e\u0432\u0435\u0441\u0442\u0438\">\u0441\u0432\u043e\u0431\u043e\u0434\u0430 \u0441\u043e\u0432\u0435\u0441\u0442\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0_%D1%81%D0%BB%D0%BE%D0%B2%D0%B0\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u0441\u043b\u043e\u0432\u0430\">\u0441\u043b\u043e\u0432\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0_%D0%BF%D0%B5%D1%87%D0%B0%D1%82%D0%B8\" class=\"mw-redirect\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u043f\u0435\u0447\u0430\u0442\u0438\">\u043f\u0435\u0447\u0430\u0442\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B9\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0439\">\u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0_%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F_%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D1%8F&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043e\u0440\u0443\u0436\u0438\u044f (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043e\u0440\u0443\u0436\u0438\u044f<\/a>).<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1821_%D0%B3%D0%BE%D0%B4\" title=\"1821 \u0433\u043e\u0434\">1821<\/a>&#160;\u2014 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%BE%D0%B5_%D0%B3%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0435 \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0435 \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e<\/a>